import { Link } from "react-router-dom";
import Logo from "../../assets/lightCubeLogo.png";

const Navigator = () => {
  return (
    <header className="fixed left-0 bottom-5 w-full px-12">
      <div className=" bg-slate-900 flex items-center justify-center p-1 border-2 border-slate-50 rounded-full">
        <button>
          <img src={Logo} alt="logo" className="w-8" />
        </button>
      </div>
    </header>
  );
};

export default Navigator;
